import { Link } from 'react-router-dom';
import axios from 'axios';

class App extends Component{
  constructor(props){
  super(props);
  this.state={
 user:[]
  };
 }

  componentDidMount() {
    axios.get('http://localhost:5000/user/')
      .then(response => {
        this.setState({ user: response.data })
      })
      .catch((error) => {
        console.log(error);
      })
  }
   render(){
     return (  
     <div>       
  <ul>
    {
       this.state.user.map((Name)=> <li>{Name.username}</li>)
    }
    </ul>
</div>

